//import axios from "axios";

/*
async function getHttp(url){
    let value;
    axios.get(url)
        .then((response)=>{
            value = response.data;
        })
        .catch((e)=>{
            throw e;
        })
    console.log(value);
    await value;
}
 */

export default {
    install(app){
        app.config.globalProperties.$httpGet=1;
    }
}
